import React from 'react';
import './Blog.css';

import Navbar from '../components/Navbar.jsx';
import Footer from '../components/Footer.jsx';

const list = ['a', 'b', 'c'];

const SimpleList = () => (
    <ul>
    {list.forEach(
        function(item) {
            return <li key={item}>{item}</li>;
        }
    )}
    </ul>
);


function Blog(){
    return(
        <div>
            <Navbar/>
            <SimpleList/>
            <Footer/>
        </div>
    );
}

export default Blog;
